drop table  works_tmp;
create table  works_tmp(
   code int, 
   num_eqp varchar(50),
   id_type int,
   dt_work date,
   position varchar(100),
   plomb varchar(50),
   object varchar(100) ,
   holo varchar(50),
   id_point int,
   id_client int
);



delete from works_tmp;














update works_tmp set id_point = mp.id_point, id_client = c.id
from 
clm_client_tbl as c 
join eqm_tree_tbl as t on (t.id_client = c.id)
join eqm_eqp_tree_tbl as tt on (tt.id_tree = t.id)
join eqm_meter_point_h as mp on (mp.id_point = tt.code_eqp)	
join eqm_equipment_h as eq on (eq.id = mp.id_meter)
where trim(eq.num_eqp) = trim(works_tmp.num_eqp) and c.code = works_tmp.code;



select id_client,id_point, 2, holo,object,dt_work from works_tmp
where id_point is not null and coalesce(holo,'')<>'';

select id_client,id_point, plomb,object,dt_work from works_tmp
where id_point is not null and coalesce(plomb,'')<>'';


select id_client,id_point, id_type,dt_work from works_tmp
where id_point is not null and dt_work is not null;

drop table  works_tmp;
